@Julialikesnfts I will NOT embrace working 24/7. We're building web 3. Web 2 working standards don't belong here. 

Work smarter, not harder. You can run around all day in a cricle but not move anywhere. 

Make each day about intention and purpose

@takoa__ Here's what I do to combat those:

I make decisions the day before. I plan out what I wear, eat, time to go gym, work blocks, meetings, etc night before. So less decision making throughout the day

I schedule blocks to soak information and consume knowledge. Knowledge is power.

